/**
 * Get inline SVG code for a skill
 * @param {string} skillName - Name of the skill
 * @returns {string|null} SVG code or null if not found
 */
export const getInlineSvg = (skillName) => {
  const normalizedName = skillName
    .toLowerCase()
    .replace(/\s+/g, "")
    .replace(/-/g, "");
  return SVG_ICONS[normalizedName] || null;
};

/**
 * Check if inline SVG exists for a skill
 * @param {string} skillName - Name of the skill
 * @returns {boolean}
 */
export const hasInlineSvg = (skillName) => {
  return getInlineSvg(skillName) !== null;
};
